CREATE or replace TABLE `tbl_fullmolddailywork` (
  `faccd` varchar(20) NOT NULL COMMENT '공장',
  `fmno` varchar(20) NOT NULL COMMENT 'FULL MOLD NO',
  `fmseq` bigint(20) unsigned NOT NULL COMMENT '순번',
  `fmdt` varchar(8) DEFAULT NULL COMMENT '등록일',
  `socust` varchar(100) DEFAULT NULL COMMENT '발주고객',
  `ptcust` varchar(100) DEFAULT NULL COMMENT '패턴제작업체',
  `ptindt` varchar(8) DEFAULT NULL COMMENT '패턴입고일',
  `carnm` varchar(200) DEFAULT NULL COMMENT '차종',
  `itmnm` varchar(300) DEFAULT NULL COMMENT '품명및 품번',
  `prcnm` varchar(50) DEFAULT NULL COMMENT '공정',
  `partnm` varchar(100) DEFAULT NULL COMMENT '부품',
  `prtqty` varchar(20) DEFAULT NULL COMMENT '부품수량',
  `matnm` varchar(20) DEFAULT NULL COMMENT '재질 - BC:DM761',
  `matno` varchar(20) DEFAULT NULL COMMENT '관리번호',
  `struct` varchar(50) DEFAULT NULL COMMENT '도형',
  `mlddt` datetime DEFAULT NULL COMMENT '조형일시',
  `flskno` varchar(50) DEFAULT NULL COMMENT 'FLASK No',
  `fkmxkg` varchar(20) DEFAULT NULL COMMENT '최대무게',
  `wcnm` varchar(20) DEFAULT NULL COMMENT '용해로',
  `firstYN` char(1) DEFAULT NULL COMMENT '재탕여부(1-초도,2이상-재탕)',
  `joindt` datetime DEFAULT NULL COMMENT '주입일시',
  `dismdt` datetime DEFAULT NULL COMMENT '해체일시',
  `afshut` varchar(200) DEFAULT NULL COMMENT '쇼트후처리',
  `askmk` varchar(200) DEFAULT NULL COMMENT '업체요청',
  `mdcust` text DEFAULT NULL COMMENT '가공처',
  `castdt` varchar(8) DEFAULT NULL COMMENT '출하일',
  `colorno` varchar(100) DEFAULT NULL COMMENT '도색NO',
  `ptkg` varchar(20) DEFAULT NULL COMMENT 'PT중량',
  `expkg` varchar(20) DEFAULT NULL COMMENT '예상중량',
  `partspc` varchar(150) DEFAULT NULL COMMENT '부품사양 - BC:AA380',
  `whnm` varchar(100) DEFAULT NULL COMMENT '완제품창고',
  `whdt` datetime DEFAULT NULL COMMENT '창고이동일시',
  `stscd` varchar(20) DEFAULT NULL COMMENT '진행상태(공정) - BC : AA360',
  `rmk` text DEFAULT NULL COMMENT '기타',
  `cid` varchar(20) DEFAULT NULL,
  `cdt` datetime DEFAULT current_timestamp(),
  `mid` varchar(20) DEFAULT NULL,
  `mdt` datetime DEFAULT NULL,
  PRIMARY KEY (`faccd`,`fmno`,`fmseq`),
  KEY `tbl_fullMoldDailyWork_matno_IDX` (`matno`,`matnm`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='PP.FULL MOLD 리스트'
;;

CREATE or replace PROCEDURE `spFullMoldDailyWork_s32`(  
    p_faccd   VARCHAR(10) 
  , p_ptindt  VARCHAR(8)
  , p_matno	  VARCHAR(8)
  , p_ckMatno VARCHAR(8)
)
    COMMENT 'FULL MOLR 작업정보조회 - 작업자화면(패턴)'
BEGIN

select
  '0' chk 
  , fmno       
  , socust
  , prcnm
  , ptcust     
  , ptindt     
  , itmnm      
  , '0' itmqty 
  , ptkg
  , '0' itmkg
  , fmseq
  , fmdt     
  , matno    
  ,partnm
--  ,fnGetFullMoldCmpntList(fmno,fmseq) partnm   
  from tbl_fullMoldDailyWork 
  where 1 = 1
    and nvl(socust,'') <> '' and nvl(ptcust,'') <> '' and nvl(itmnm,'') <> ''
    and ( nvl(p_faccd,'') = ''     or  faccd = p_faccd )
    and ( nvl(p_ptindt,'') = ''    or  ptindt = p_ptindt )
    and ( nvl(p_matno,'') = ''    or  matno like concat('%',p_matno,'%'))
    and ( nvl(p_ckMatno,'0') = '0'    or  case when p_ckMatno="1" then nvl(matno,'') = '' end)      
    and stscd in('AA360010','AA360020','AA360030','AA360040')
order by matno ;
END
;;





